import React,{useEffect, Fragment} from 'react';
import{ connect }  from "react-redux";
import Spinner from "../layout/Spinner";
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';
import {getGithubRepo} from '../../actions/profile';

function GitHubDetail({profile,getGithubRepo,repos}) {

    useEffect(() => {
        getGithubRepo(profile.profile.handle);
    }, [getGithubRepo]);

    return (
        <Fragment>
            <div class="profile-github">
          <h2 class="text-primary my-1">
            <i class="fab fa-github"></i> Github Repos
          </h2>
          <div class="repo bg-white p-1 my-1">
            <div>
              <h4><a href="#" target="_blank"
                  rel="noopener noreferrer">Repo One</a></h4>
              <p>
                Lorem ipsum dolor sit amet consectetur adipisicing elit.
                Repellat, laborum!
              </p>
            </div>
            <div>
              <ul>
                <li class="badge badge-primary">Stars: 44</li>
                <li class="badge badge-dark">Watchers: 21</li>
                <li class="badge badge-light">Forks: 25</li>
              </ul>
            </div>
          </div>
        </div>
        </Fragment>
    )
}

GitHubDetail.propTypes = {
    profile: PropTypes.object.isRequired,
    repos: PropTypes.object.isRequired,
    getGithubRepo: PropTypes.func.isRequired,

}

const mapStateToProps=state=>({
    profile : state.profile,
    repos: state.repos
  })
  
export default connect(mapStateToProps, { getGithubRepo })(GitHubDetail);
